fragment:
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:hydrothermal_fluid rdfs:subClassOf :leachate ;
    :has_definition "High temperature water ejected from hydrothermal vents and laden with dissolved metals and minerals as a result of percolation through crustal rocks."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:nitrate_reducing_sediment rdfs:subClassOf :anaerobic_sediment ;
    :has_definition "Sediment hosting and characterised by active nitrate reducing microbial communities."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:drop_stone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :submerged_bed ],
        :piece_of_rock ;
    :has_definition "A piece of rock which fell vertically through the water column into finer-grained water-deposited sedimentary rocks."@en ;
    :has_exact_synonym "dropstone"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:organic_matter_fall rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :surrounded_by ;
            owl:someValuesFrom :liquid_water ],
        [ a owl:Restriction ;
            owl:onProperty :located_in ;
            owl:someValuesFrom :water_body ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :submerged_bed ],
        :mass_of_biological_material ;
    :has_definition "An accumulation of organic matter that has fallen to the bottom of a body of water."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:plant_matter_fall rdfs:subClassOf :organic_matter_fall ;
    :has_definition "A accumulation of plant matter that has fallen to the bottom of a body of water."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:animal_carcass_fall rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :submerged_bed ],
        [ a owl:Restriction ;
            owl:onProperty :located_in ;
            owl:someValuesFrom :water_body ],
        [ a owl:Restriction ;
            owl:onProperty :surrounded_by ;
            owl:someValuesFrom :liquid_water ],
        :carcass ;
    :has_definition "The carcass of an animal that has fallen to the bottom of a body of water."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:whale_fall rdfs:subClassOf :animal_carcass_fall ;
    :has_definition "Whale fall is the term used for a whale carcass that has fallen to the ocean floor. When a whale dies in shallow water, its carcass is typically devoured by scavengers over a relatively short period of time: within several months. However, in deeper water (depths of 2,000 m/6,600 ft or greater), fewer scavenger species exist, and the carcass can provide sustenance for a complex localized ecosystem over periods of decades."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:seal_fall rdfs:subClassOf :animal_carcass_fall ;
    :has_definition "Seal fall is the term used for a seal carcass that has fallen to the ocean floor."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:wood_fall rdfs:subClassOf :plant_matter_fall ;
    :has_definition "A wood fall describes an accumulation of woody plant material that has fallen to the ocean floor."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:marine_reef rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :located_in ;
            owl:someValuesFrom :marine_water_body ],
        :reef ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :reef ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :located_in ;
                                    owl:someValuesFrom :marine_water_body ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A reef which is located in a marine water body."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:marine_coral_reef_flat_zone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :coral_reef ],
        :marine_reef .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:marine_coral_reef_back_reef rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :coral_reef ],
        :marine_reef .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:marine_coral_reef_crest rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :coral_reef ],
        :marine_reef .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:marine_coral_reef_fore_reef rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :coral_reef ],
        :marine_reef .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:marine_coral_reef_buttress_zone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :coral_reef ],
        :marine_reef .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:marine_coral_reef_deep_fore_reef rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :coral_reef ],
        :marine_reef .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:marine_subtidal_rocky_reef rdfs:subClassOf :marine_reef,
        :rocky_reef ;
    :has_definition "A rocky reef which is located in the subtidal zone of a marine water body."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:manganese_reducing_sediment rdfs:subClassOf :anaerobic_sediment ;
    :has_definition "Sediment hosting and characterised by active manganese reducing microbial communities."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:iron_reducing_sediment rdfs:subClassOf :anaerobic_sediment ;
    :has_definition "Sediment hosting and characterised by active iron reducing microbial communities."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:sulphate_reducing_sediment rdfs:subClassOf :anaerobic_sediment ;
    :has_definition "Sediment hosting and characterised by active sulphate reducing microbial communities."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:carbon_dioxide_reducing_sediment rdfs:subClassOf :anaerobic_sediment ;
    :has_definition "Sediment hosting and characterised by active carbon dioxide reducing microbial communities."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:organic_material rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :biomacromolecule ],
        :environmental_material ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :environmental_material ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom :biomacromolecule ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "Environmental material derived from living organisms and composed primarily of one or more biomacromolecules."^^xsd:string ;
    :has_exact_synonym "biomass" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:biofilm_material rdfs:subClassOf :organic_material ;
    :has_definition "Material derived from a biofilm, an aggregate of microorganisms in which cells adhere to each other and/or to a surface. These adherent cells are frequently embedded within a self-produced matrix of extracellular polymeric substance (EPS). Biofilm EPS, which is also referred to as slime, is a polymeric conglomeration generally composed of extracellular DNA, proteins, and polysaccharides in various configurations."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:microbial_mat_material rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :microbial_mat ],
        :organic_material ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :organic_material ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :derives_from ;
                                    owl:someValuesFrom :microbial_mat ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "Material derived from a microbial mat, a multi-layered sheet of micro-organisms, mainly bacteria and archaea. Microbial mats create a wide range of internal chemical environments."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:marine_snow rdfs:subClassOf :detritus ;
    :has_definition "Marine snow is a continuous shower of mostly organic detritus falling from the upper layers of the water column. Its origin lies in activities within the productive photic zone."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:marine_pockmark rdfs:subClassOf :crater ;
    :has_definition "Pockmarks are craters in the seabed resulting from the release of gas or liquid. Generally, they are formed in soft, fine-grained seabed sediments by the escape of fluids (gas or water, but mainly methane) into the water column."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:marine_sponge_reef rdfs:subClassOf :marine_reef ;
    :has_definition "A marine sponge reef is marine reefs primarily built by marine sponges. The primary frame-building sponges are all members of the order Hexactinosa. They are found only in glacier-scoured troughs of low-angle continental shelf. The seafloor is stable and consists of rock, coarse gravel, and large boulders."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:organ rdfs:subClassOf :organic_object ;
    :has_definition "A collection of tissues joined in structural unit to serve a common function."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:photophore rdfs:subClassOf :organ ;
    :has_definition "A photophore is a light-emitting organ which appears as luminous spots on various marine animals, including fish and cephalopods. The organ can be simple, or as complex as the human eye; equipped with lenses, shutters, color filters and reflectors. The light can be produced from compounds during the digestion of prey, from specialized mitochondrial cells in the organism, called photocytes (\"light producing\" cells) , or, similarly, associated with symbiotic  bacteria in the organism."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:root_nodule rdfs:subClassOf :organ ;
    :has_definition "Root nodules occur on the roots of plants that associate with symbiotic nitrogen-fixing bacteria."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:trophosome rdfs:subClassOf :organ ;
    :has_definition "A specialised organ found in deep-sea tube worms populating hydrothermal vent environments that is colonised by chemosynthetic bacteria which supply the host worm with organic compounds. The term may be applied to similar organs in other worms."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:mycetome rdfs:subClassOf :organ ;
    :has_definition "A specialized organ that is linked to the gut in beetles and host to a symbiotic yeast. The yeast cells assist in the digestion of less nutritious foods, supply needed B-vitamins and sterols, and provide resistance to certain toxins."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:determinate_root_nodule rdfs:subClassOf :root_nodule ;
    :has_definition "Determinate nodules are root nodules found on tropical (sub)legumes, such as those of the genera Glycine (soybean), Phaseolus  (common bean), Lotus, and Vigna. Determinate nodules lose meristematic activity shortly after initiation, thus growth is due to cell expansion resulting in mature nodules which are spherical in shape."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:indeterminate_root_nodule rdfs:subClassOf :root_nodule ;
    :has_definition "Indeterminate nodules are found on temperate legumes like Pisum  (pea), Medicago (alfalfa), Trifolium (clover), and Vicia (vetch). They earned the moniker \"indeterminate\" because they maintain an active apical meristem that produces new cells for growth over the life of the nodule. Because they are actively growing, indeterminate nodules manifest zones which demarcate different stages of development/symbiosis."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:indeterminate_root_nodule_active_meristem rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :indeterminate_root_nodule ],
        :indeterminate_root_nodule ;
    :has_definition "A part of an indeterminate root nodule where new nodule tissue is formed which will later differentiate into the other zones of the nodule."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:indeterminate_root_nodule_infection_zone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :indeterminate_root_nodule ],
        :indeterminate_root_nodule ;
    :has_definition "A part of an indeterminate root nodule permeated with infection threads full of bacteria. The plant cells are larger than in the previous zone and cell division is halted."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:indeterminate_root_nodule_nitrogen_fixation_zone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :indeterminate_root_nodule ],
        :indeterminate_root_nodule ;
    :has_definition "A part of an indeterminate root nodule where each cell contains a large, central vacuole and the cytoplasm is filled with fully differentiated bacteroids which are actively fixing nitrogen. Typically, the plant provides these cells with leghemoglobin, resulting in a distinct pink color."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:indeterminate_root_nodule_senescent_zone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :indeterminate_root_nodule ],
        :indeterminate_root_nodule ;
    :has_definition "A part of an indeterminate root nodule where plant cells and their bacteroid contents are being degraded. The breakdown of the heme component of leghemoglobin results in a visible greening at the base of the nodule."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:anoxic_water rdfs:subClassOf [ owl:complementOf [ a owl:Restriction ;
                    owl:onProperty :has_part ;
                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :dioxygen ;
                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                    owl:onProperty :has_quality ;
                                                    owl:someValuesFrom :dissolved ] ;
                                            rdf:rest :nil ] ] ] ] ],
        :liquid_water ;
    :has_definition "Water which lacks dissolved oxygen."^^xsd:string ;
    :has_exact_synonym "anaerobic water" ;
    :has_related_synonym "reducing water" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:forest_biome rdfs:subClassOf :forest_ecosystem ;
    :has_definition "A forest ecosystem in which dominant ecological communities have reached their climax successional state."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:woodland_biome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :woodland_area ],
        :terrestrial_biome ;
    :has_definition "A woodland biome is a terrestrial biome which includes, across its entire spatial extent, woody plants spaced sufficiently far apart to allow light penetration to support communities of herbaceous plants or shrubs living closer to the woodland floor."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:shrubland_biome rdfs:subClassOf :terrestrial_biome ;
    :has_definition "A shrubland biome is a terrestrial biome which includes, across its entire spatial extent, dense groups of shrubs."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:grassland_biome rdfs:subClassOf :grassland_ecosystem ;
    :has_definition "A grassland ecosystem in which dominant ecological communities have reached their climax successional state."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:savanna_biome rdfs:subClassOf :woodland_biome ;
    :has_definition "A woodland biome which has seasonal water availability and includes trees spaced sufficiently far apart to allow an unbroken layer of grass, sedge (Cyperaceae) or  rush (Juncaceae) communities to live."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:desert_biome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :desert_area ],
        [ a owl:Restriction ;
            owl:onProperty :determined_by ;
            owl:someValuesFrom :ecological_community ],
        :desert_ecosystem ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :desert_ecosystem ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :determined_by ;
                                    owl:someValuesFrom :ecological_community ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A desert biome is a terrestrial biome which loses more liquid water by evapotranspiration than is supplied by precipitation and includes communities adapted to these conditions."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:tundra_biome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :area_of_tundra ],
        :terrestrial_biome ;
    :has_definition "A terrestrial biome which comprises a tundra ecosystem that has reached its climax community."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:mangrove_biome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :mangrove_swamp ],
        :terrestrial_biome ;
    :has_definition "A mangrove biome is a terrestrial biome which includes, across its spatial extent, mangrove plants (Rhizophoraceae). Mangrove plants are able to withstand high levels of salinity as well as regions of anoxia and frequent tidal inundation. Mangrove biomes often occur near tropical and sub-tropical estuaries and depositional marine coastal environments where fine sediments (often with high organic content) collect in areas protected from high energy wave action."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:temperate_desert_biome rdfs:subClassOf :desert_biome,
        :temperate_environment ;
    :has_definition "A temperate desert biome is a desert biome which has communities adapted to intermediate insolation, low rainfall, and large temperature variations between winter and summer. Winter temperatures may fall below 0 degrees Celsius. Some precipitation in this biome may fall as snow."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:tropical_desert_biome rdfs:subClassOf :desert_biome,
        :tropical_environment ;
    :has_definition "A tropical desert biome is a desert biome which has communities adapted to temperatures above a monthly average of 18 degrees Celsius, high daily temperature ranges of approximately 20 degrees Celsius, very high insolation due to inhibited cloud formation, and very low precipitation. Tropical desert biomes located near coasts with cold upwellings may have cooler temperatures and reduced insolution due to fog."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:subtropical_desert_biome rdfs:subClassOf :desert_biome,
        :subtropical_environment ;
    :has_definition "A subtropical desert biome is a desert biome which has communities adapted to temperatures above a monthly average of 18 degrees Celsius, high daily temperature ranges of approximately 20 degrees Celsius, high insolation (but lower than that of a tropical desert biome), inhibited cloud formation, and very low precipitation. Subtropical desert biomes located near coasts with cold upwellings may have cooler temperatures and reduced insolution due to fog."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:montane_desert_biome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :montane ],
        :desert_biome ;
