@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:cropland_biome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :anthropisation ],
        :cropland_ecosystem ;
    :has_definition "A cropland ecosystem in which dominant ecological communities are maintained in a stable state - mimicking a climax community - by human intervention."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:village_biome rdfs:subClassOf :anthropogenic_terrestrial_biome ;
    :has_definition "A village biome is an anthropogenic terrestrial biome which contains settlements such as villages, towns, and/or small cities and which is primarily used for agricultural activity."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:rangeland_biome rdfs:subClassOf :anthropogenic_terrestrial_biome ;
    :has_definition "A rangeland biome is an anthropogenic terrestrial biome which is primarily used for the rearing and grazing of livestock."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:dense_settlement_biome rdfs:subClassOf :anthropogenic_terrestrial_biome ;
    :has_definition "A dense settlement biome is an anthropogenic terrestrial biome which is primarily used for human habitation, recreation, and industry within built structures with little other land use."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:urban_biome rdfs:subClassOf :dense_settlement_biome ;
    :has_definition "An urban biome is a dense settlement biome which has been urbanised."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:subpolar_coniferous_forest_biome rdfs:subClassOf :coniferous_forest_biome,
        :subpolar_environment ;
    :has_definition "A  coniferous forest biome which includes communities adapted to subpolar conditions."^^xsd:string ;
    :has_narrow_synonym "boreal forest"^^xsd:string,
        "taiga"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:subpolar rdfs:subClassOf :environmental_condition ;
    :has_definition "A subpolar condition is an environmental condition in which an environmental system receives low, yearly solar irradiance per unit area and is surrounded by large land masses. This results in very cold winters with temperatures potentially falling to around -40 degrees Celsius and summers which last no more than 3 months of the year with a 24-hour average temperature of at least 10 degrees Celsius."^^xsd:string ;
    :has_exact_synonym "boreal"^^xsd:string,
        "subarctic"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:freshwater_lake_biome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :freshwater_lake ],
        :freshwater_biome ;
    :has_definition "A biome which is determined by a freshwater lake." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:freshwater_river_biome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :freshwater_river ],
        :freshwater_biome ;
    :has_definition "A freshwater biome which is determined by a freshwater river."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:environmental_system rdfs:subClassOf :system ;
    :has_definition "A system which has the disposition to environ one or more material entities."^^xsd:string ;
    :has_exact_synonym "environment"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:mineral_deposit rdfs:subClassOf :surface_landform ;
    :has_definition "A mineral deposit is a physiographic feature which has unusually high concentrations of one or more minerals."^^xsd:string ;
    :has_exact_synonym "mineral ore deposit" ;
    :has_narrow_synonym "ore deposit"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:mineral_material rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :mineral ],
        :solid_environmental_material ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :environmental_material ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom :mineral ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A mineral material is an environmental material which is primarily composed of some substance that is naturally occurring, solid and stable at room temperature, representable by a chemical formula, usually abiogenic, and that has an ordered atomic structure."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:white_smoker rdfs:subClassOf :marine_hydrothermal_vent ;
    :has_definition "A hydrothermal vent found on the ocean floor which emits lighter-hued minerals, such as those containing barium, calcium and silicon. These alkaline hydrothermal vents also continuously generate acetyl thioesters, providing both the starting point for more complex organic molecules and the energy needed to produce them."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:fluid_cline rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :gaseous_environmental_material ;
                            rdf:rest [ rdf:first :liquid_environmental_material ;
                                    rdf:rest :nil ] ] ] ],
        :fluid_front ;
    :has_broad_synonym "cline" ;
    :has_definition "A fluid front which is 1) thin in comparison to the fluid mass it is a part of and 2) across which a property of that fluid mass varies greatly over short vertical distance, relative to variation across the entire fluid mass."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:pycnocline rdfs:subClassOf :fluid_cline ;
    :has_definition "A cline across which the density of a fluid changes rapidly."^^xsd:string ;
    :has_related_synonym "stable density gradient"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:nutricline_within_a_water_body rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :water_body ],
        :nutricline ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :nutricline ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :part_of ;
                                    owl:someValuesFrom :water_body ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A nutricline which is part of a water body."^^xsd:string ;
    :has_related_synonym "nutrient gradient"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:seep rdfs:subClassOf :spring ;
    :has_definition "A seep is a spring in which water has filtered through permeable earth to the surface."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:cold_seep rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :ocean_floor ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :sea_floor ],
        :seep ;
    :has_definition """MERGED DEFINITION:
TARGET DEFINITION: A cold seep is a seep in which methane and other hydrocarbon-rich fluids rise to the sea floor.
--------------------
SOURCE DEFINITION: An area of the ocean floor where hydrogen sulfide, methane and other hydrocarbon-rich fluid seepage occurs. Cold seeps are distinct from hydrothermal vents: the former's emissions are of the same temperature as the surrounding seawater, whereas the latter's emissions are super-heated."""^^xsd:string ;
    :has_exact_synonym "hydrocarbon seep"^^xsd:string,
        "methane seep"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:hydrothermal_seep rdfs:subClassOf :seep ;
    :has_definition "A hydrothermal seep is a seep in which diffuse flow of geothermally heated fluids with high methane concentrations. This seep has been proposed as an intermediate between cold seeps and hydrothermal vents."^^xsd:string ;
    :has_related_synonym "hot seep"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:water_vapour rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :water ],
        :gaseous_environmental_material ;
    :has_definition "Water vapour is a vapour which is the gas phase of water."^^xsd:string ;
    :has_exact_synonym "aqueous vapor"^^xsd:string,
        "aqueous vapour"^^xsd:string,
        "water vapor"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:atmosphere rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :astronomical_body ],
        [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :environmental_material ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :quality_of_a_gas ] ;
                                    rdf:rest :nil ] ] ] ],
        :fluid_layer ;
    :has_definition "An atmosphere is a layer of gases surrounding a material body of sufficient mass that is held in place by the gravity of the body."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:atmospheric_water_vapour rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_role ;
            owl:someValuesFrom :greenhouse_gas ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :atmosphere ],
        :water_vapour ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :water_vapour ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :part_of ;
                                    owl:someValuesFrom :atmosphere ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "Atmospheric water vapour is water vapour that is part of an atmosphere."^^xsd:string ;
    :has_exact_synonym "atmospheric water vapor"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:siltstone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :silt ],
        :clastic_sedimentary_rock ;
    :has_definition "A sedimentary rock which is composed mainly of silt. This rock has a grainsize in the silt range, finer than sandstone and coarser than claystones."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:claystone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :clay ],
        :clastic_sedimentary_rock ;
    :has_definition "A clastic sedimentary rock which is composed primarily of clay sized particles."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:clastic_sedimentary_rock rdfs:subClassOf :sedimentary_rock ;
    :has_definition "Clastic sedimentary rocks are sedimentary rocks that are composed of silicate minerals and rock fragments that were transported by moving fluids. Clastic rocks are composed largely of quartz, feldspar, rock (lithic) fragments, clay minerals, and mica; numerous other minerals may be present as accessories and may be important locally."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:mudstone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :mud ],
        :clastic_sedimentary_rock ;
    owl:disjointWith :lime_mudstone ;
    :has_definition "A mudstone is a clastic sedimentary rock which contains a mixture of at least one third of silt- and one third of clay-sized particles."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:lime_mudstone rdfs:subClassOf :limestone ;
    :has_definition "Lime mudstone is a limestone which is primarily composed of either clay-size or both silt-size and clay-size detrital (transported) carbonate grains."^^xsd:string ;
    :has_exact_synonym "calcilutite"^^xsd:string,
        "cementstone"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:slate rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :clastic_sedimentary_rock ],
        :metamorphic_rock ;
    :has_definition "Slate is a metamorphic rock which is fine-grained, foliated, homogeneous, Slates are derived from clastic sedimentary rocks."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:structural_basin rdfs:subClassOf :depressed_landform ;
    :has_definition "A structural basin is a geological depression formed by tectonic warping of previously flat lying rock strata."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ecoregion rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :ecozone ],
        :ecosystem ;
    :has_definition "A large unit of land or water containing a geographically distinct assemblage of species, natural communities, and environmental conditions."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:water_ice rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :liquid_water ],
        [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :freezing_of_water_into_water_ice ;
                            rdf:rest [ rdf:first :compaction_process ;
                                    rdf:rest [ rdf:first :desublimation_of_water_vapour_into_ice ;
                                            rdf:rest :nil ] ] ] ] ],
        :ice,
        :solid_environmental_material ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :ice ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom :liquid_water ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "Ice which is formed from water."^^xsd:string ;
    :has_related_synonym "ice" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:pingo_scar rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :pingo ],
        :depressed_landform,
        :surface_landform ;
    :has_definition "A depression caused by the collapse of a pingo."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ice_lens rdfs:subClassOf :land_ice_mass ;
    :has_definition "An ice mass which is formed when moisture, diffused within soil or rock, accumulates and freezes in a localized zone, wedging soil or rock apart."^^xsd:string ;
    :has_exact_synonym "ice lenses"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ecozone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :biosphere ],
        :ecosystem ;
    :has_definition "Ecozones delineate large areas of a planetary surface within which organisms have been evolving in relative isolation over long periods of time, separated from one another by geographic features, such as oceans, broad deserts, or high mountain ranges, that constitute barriers to migration."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:layer rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :laminar ],
        :material_entity ;
    :has_definition "A layer is a quantity of some material which is spatially continuous, has comparable thickness, and usually covers some surface."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:sedimentary_stratum rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :soil ;
                            rdf:rest [ rdf:first :sedimentary_rock ;
                                    rdf:rest :nil ] ] ] ],
        :solid_layer ;
    :has_broad_synonym "stratum" ;
    :has_definition "A stratum is a layer which is composed of sedimentary rock or soil with internally consistent characteristics that distinguish it from other layers."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:lake_layer rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :lake ],
        :aquatic_layer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :aquatic_layer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :part_of ;
                                    owl:someValuesFrom :lake ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A layer which is part of a lake."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:amictic_lake rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :surface_layer ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :adjacent_to ;
                                            owl:someValuesFrom :water_ice ] ;
                                    rdf:rest :nil ] ] ] ],
        :lake ;
    owl:disjointWith :holomictic_lake ;
    :has_definition "A lake which is permanently covered by ice, does not mix, and exhibit inverse cold water stratification whereby water temperature increases with depth below the ice surface."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:holomictic_lake rdfs:subClassOf :lake ;
    :has_definition "A holomictic lake is a lake which mixes at least once per year. Mixing is caused by a uniform temperature distribution from the upper to lower layers of the lake."^^xsd:string ;
    :has_related_synonym "non-meromictic lake"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:dimictic_lake rdfs:subClassOf :holomictic_lake ;
    owl:disjointWith :monomictic_lake,
        :polymictic_lake ;
    :has_definition "A dimitic lake is a holomictic lake which mixes from top to bottom during two mixing periods each year. Mixing typically occurs during the spring and autumn, when the lake is \"isothermal\" (i.e., at the same temperature from the top to the bottom). At this time the water throughout the lake is about 4°C, and, in the absence of any temperature or density differences, the lake readily mixes from top to bottom. These lakes are common in regions with temperate climates."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:polymictic_lake rdfs:subClassOf :holomictic_lake ;
    owl:disjointWith :monomictic_lake ;
    :has_definition "A polymictic lake is a holomictic lake which is too shallow to allow thermal stratification and which can mix from top to bottom through the ice-free period of the year."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:monomictic_lake rdfs:subClassOf :holomictic_lake ;
    :has_definition "A monomictic  lake is a holomictic lake which mixes from top to bottom during one mixing period each year."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:cold_monomictic_lake rdfs:subClassOf :monomictic_lake ;
    :has_definition "A monomictic lake which is covered by ice throughout much of the year and only mixes when its surface ice melts and the lake lacks thermal stratification."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:warm_monomictic_lake rdfs:subClassOf :monomictic_lake ;
    :has_definition "A monomictic lake which does not freeze and is thermally stratified throughout most of the year, only mixing in winter when cooler temperatures ease stratification."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:cold_polymictic_lake rdfs:subClassOf :polymictic_lake ;
    :has_definition "A cold polymictic lake is a polymictic lake which is covered by ice in winter."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:warm_polymictic_lake rdfs:subClassOf :polymictic_lake ;
    :has_definition "A warm polymictic lake is a polymictic lake which is not covered by ice at any point during the year."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ice_mass rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :water_ice ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :cryosphere ],
        :mass_of_solid_material ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :mass_of_solid_material ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom :water_ice ] ;
                            rdf:rest :nil ] ] ] ;
    :has_broad_synonym "accumulation of ice",
        "ice accumulation" ;
    :has_definition "A mass of water ice."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:crevice rdfs:subClassOf :geological_fracture ;
    :has_definition "A deep fissure in rock."^^xsd:string ;
    :has_related_synonym "crevice" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:marine_layer rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :ocean ;
                            rdf:rest [ rdf:first :sea ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :marine_water_body ],
        [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :sea_water ],
        :aquatic_layer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :aquatic_layer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :part_of ;
                                    owl:someValuesFrom [ owl:unionOf [ rdf:first :ocean ;
                                                    rdf:rest [ rdf:first :sea ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A layer that is part of a marine water body."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:dry_lake_bed rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :dry_lake ],
        [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :dry ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :atmosphere ;
                            rdf:rest [ rdf:first :outer_space ;
                                    rdf:rest :nil ] ] ] ],
        :solid_surface_layer,
        :surface_of_an_astronomical_body ;
    :has_definition "A lake bed which is dry. That is, the bed of a dry lake."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:freshwater_river rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :fresh_water ],
        :river ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :river ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_part ;
                                    owl:someValuesFrom :fresh_water ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A river where fresh water flows."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:continental_margin rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :sea_floor ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :continental_shelf ;
                            rdf:rest [ rdf:first :continental_slope ;
                                    rdf:rest [ rdf:first :continental_rise ;
                                            rdf:rest :nil ] ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :continental_crust ],
        [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :oceanic_crust ],
        :slope ;
    :has_definition "A slope which is part of the seafloor, descends from the continental crust to the oceanic crust, and comprises the continental shelf, continental slope, and continental rise."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:taylor_column rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :mass_fluid_flow ],
        [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :columnar ],
        :fluid_astronomical_body_part ;
    :has_definition "A Taylor column is a column of deflected fluid flow which is formed in a perturbed, rotating fluid, is parallel to the axis of rotation, and extends above the obstacle perturbing the fluid in a rigid manner."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:atmospheric_taylor_column rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :located_in ;
            owl:someValuesFrom :atmosphere ],
        :taylor_column ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :taylor_column ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :located_in ;
                                    owl:someValuesFrom :atmosphere ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An atmospheric Taylor column is a Taylor column that is formed in the atmosphere. Atmospheric Taylor columns often form above islands resulting in vortex streets in the atmosphere."^^xsd:string ;
    :has_related_synonym "vortex street"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:estuarine_water rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :brackish_estuary ],
        :brackish_water ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :brackish_water ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :part_of ;
                                    owl:someValuesFrom :brackish_estuary ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "Brackish water which is part of an estuary."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:outcrop rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :environmental_material ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :protruding_out_of ] ;
                                    rdf:rest :nil ] ] ] ],
        :surface_landform ;
    :has_definition "A portion of environmental material which protrudes through a surface layer."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:endolithic_environment rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :surrounded_by ;
            owl:someValuesFrom :rock ],
        :environmental_system ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :environmental_system ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :surrounded_by ;
                                    owl:someValuesFrom :rock ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An endolithic environment is an environment that exists within solid rock." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:high_pressure_environment rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :increased_pressure ],
        :environmental_system_determined_by_a_quality ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :environmental_system_determined_by_a_quality ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_quality ;
                                    owl:someValuesFrom :increased_pressure ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A high pressure environment is an environment in which all material entities are exposed to a high ratio of force per unit area." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:high_temperature_environment rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :increased_temperature ],
        :environmental_system_determined_by_a_quality ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :environmental_system_determined_by_a_quality ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_quality ;
                                    owl:someValuesFrom :increased_temperature ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A high temperature environment is an environment in which material entities are exposed to increased levels of heat radiation or which have molecules or atoms moving randomly with increased levels of average kinietic energy." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:freshwater_environment rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :determined_by ;
            owl:someValuesFrom :fresh_water ],
        :aquatic_environment ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :aquatic_environment ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :determined_by ;
                                    owl:someValuesFrom :fresh_water ] ;
                            rdf:rest :nil ] ] ] ;
    :alternative_term "Water (non-saline)" ;
    :has_definition "An aquatic environment which is determined by freshwater." ;
    :has_exact_synonym "fresh water environment" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:saline_water_environment rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :determined_by ;
            owl:someValuesFrom :saline_water ],
        :aquatic_environment,
        :saline_environment ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :aquatic_environment ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :determined_by ;
                                    owl:someValuesFrom :saline_water ] ;
                            rdf:rest :nil ] ] ] ;
    :alternative_term "Water (saline)" ;
    :has_definition "An environmental system which has its properties and dynamics determined by saline water." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:extraterrestrial_environment rdfs:subClassOf :environmental_system ;
    :has_definition "An environmental system which is located beyond the Earth's exosphere and away from the Earth's core." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cold_environment rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :decreased_temperature ],
        :environmental_system ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :environmental_system ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_quality ;
                                    owl:someValuesFrom :decreased_temperature ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An environment which has a lower temperature than some local or global average." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:haline_environment rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :environmental_material ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_increased_levels_of ;
                                            owl:someValuesFrom :sodium_chloride ] ;
                                    rdf:rest :nil ] ] ] ],
        :high_osmolarity_environment ;
    :has_definition "A haline environment is an environment in which entities are exposed to high concentrations of salt, typically above 2 molar." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:cultivated_environment rdfs:subClassOf :anthropogenic_environment ;
    :has_definition "A cultivated environment is an environment that has been modified by humans by the preparation of the land, usually for the purposes of growing crops."^^xsd:string ;
    :has_narrow_synonym "cropland"^^xsd:string ;
    :has_related_synonym "CROPLAND"^^xsd:string,
        "agricultural region"^^xsd:string,
        "cultivated area"^^xsd:string,
        "cultivated cropland"^^xsd:string,
        "market garden"^^xsd:string,
        "range"^^xsd:string,
        "truck farm"^^xsd:string,
        "truck garden"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:culturing_environment rdfs:subClassOf :anthropogenic_environment ;
    :has_definition "A culturing environment is an environment which is maintained by humans for the purposes of preparing cell, organ, tissue and plant tissue cultures."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anthropogenic_environment rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :determined_by ;
            owl:someValuesFrom [ a owl:Restriction ;
                    owl:onProperty :output_of ;
                    owl:someValuesFrom :anthropisation ] ],
        :environmental_system ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :environmental_system ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :determined_by ;
                                    owl:someValuesFrom [ a owl:Restriction ;
                                            owl:onProperty :output_of ;
                                            owl:someValuesFrom :anthropisation ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An anthropogenic environment is an environmental system which is the product of human activity." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:high_osmolarity_environment rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :increased_osmolarity ],
        :environmental_system_determined_by_a_quality ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :environmental_system_determined_by_a_quality ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_quality ;
                                    owl:someValuesFrom :increased_osmolarity ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A high osmolarity environment is an environment in which entities are exposed to high concentrations of solutes." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acidic_environment rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :determined_by ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :entity ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :acidic ] ;
                                    rdf:rest :nil ] ] ] ],
        :environmental_system_determined_by_a_quality ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :environmental_system ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :determined_by ;
                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :entity ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :has_quality ;
                                                                    owl:someValuesFrom :acidic ] ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An acidic environment is an environment in which material entities are exposed to a low pH." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alkaline_environment rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :alkaline ],
        :environmental_system_determined_by_a_quality ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :environmental_system_determined_by_a_quality ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_quality ;
                                    owl:someValuesFrom :alkaline ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An alkaline environment is an environment in which entities are exposed to high pH, typically greater than a pH of 9." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:aquatic_environment rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :determined_by ;
            owl:someValuesFrom :liquid_water ],
        :environmental_system_determined_by_a_material,
        :environmental_system_determined_by_a_quality ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :environmental_system ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :determined_by ;
                                    owl:someValuesFrom :liquid_water ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An environment whose dynamics are strongly influenced by water." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:extreme_high_temperature_environment rdfs:subClassOf :high_temperature_environment ;
    :has_definition "An extreme high temperature environment is a high temperature environment in which entities are exposed to temperatures above 80 degrees Celsius." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rocky_slope rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :surface_layer ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :composed_primarily_of ;
                                            owl:someValuesFrom :rock ] ;
                                    rdf:rest :nil ] ] ] ],
        :slope ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :slope ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_part ;
                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :surface_layer ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :composed_primarily_of ;
                                                                    owl:someValuesFrom :rock ] ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A rocky slope is a slope which has a surface primarily composed of rock." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:marine_environment rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :determined_by ;
            owl:someValuesFrom :marine_water_body ],
        :environmental_system ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :environmental_system ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :determined_by ;
                                    owl:someValuesFrom :marine_water_body ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A marine environment and enviroment which is determined by a marine water body."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sea_water_environment rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :determined_by ;
            owl:someValuesFrom :sea_water ],
        :saline_water_environment ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :saline_water_environment ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :determined_by ;
                                    owl:someValuesFrom :sea_water ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An environmental system determined by seawater." ;
    :has_exact_synonym "ocean water environment" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

