                                    owl:onProperty :determined_by ;
                                    owl:someValuesFrom :brackish_water ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An environment determined by the presence of brackish water." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:atmospheric_boundary_layer rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :bounding_layer_of ;
            owl:someValuesFrom :atmosphere ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :planetary_surface ],
        :atmospheric_layer,
        :boundary_layer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first [ owl:intersectionOf [ rdf:first :boundary_layer ;
                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                    owl:onProperty :part_of ;
                                                    owl:someValuesFrom :atmosphere ] ;
                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                            owl:onProperty :adjacent_to ;
                                                            owl:someValuesFrom :planetary_surface ] ;
                                                    rdf:rest :nil ] ] ] ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :bounding_layer_of ;
                                    owl:someValuesFrom :atmosphere ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "The atmospheric boundary layer is the lowest layer of an atmosphere which is strongly influenced by its contact with a planetary surface with strong vertical mixing and in which physical quantities such as flow velocity, temperature, and moisture display rapid fluctuations (turbulence)." ;
    :has_exact_synonym "planetary boundary layer" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:planetary_surface rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :planet ],
        :surface_of_an_astronomical_body ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :surface_of_an_astronomical_body ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :part_of ;
                                    owl:someValuesFrom :planet ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A planetary surface is a surface layer where the solid or liquid material of a planet comes into contact with an atmosphere or outer space." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:aquatic_layer rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :liquid_water ],
        :liquid_layer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :liquid_layer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom :liquid_water ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A layer in a water mass, itself composed primarily of water." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:deep_chlorophyll_maximum_layer rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_increased_levels_of ;
            owl:someValuesFrom :chlorophyll ],
        :aquatic_layer ;
    :has_definition "A subsurface layer in a water body, typically an ocean or lake, in which chlorophyll concentrations reach their maximum." ;
    :has_exact_synonym "DCM" ;
    :has_related_synonym "subsurface chlorophyll maximum layer" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:strand_swamp rdfs:subClassOf :swamp_ecosystem ;
    :has_definition "A strand swamp is a swamp that forms linear drainage channels on flatlands." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dome_swamp rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :partially_surrounded_by ;
            owl:someValuesFrom :depressed_landform ],
        :swamp_ecosystem ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :swamp_ecosystem ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :partially_surrounded_by ;
                                    owl:someValuesFrom :depressed_landform ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A dome swamp is a swamp which occurs in a depression where deeper waters at the centre of the swamp allow  trees to grow taller relative to those in shallower regions of the depression. This creates a dome-like shape." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cypress_dome rdfs:subClassOf :dome_swamp ;
    :has_definition "A cypress dome swamp is a dome swamp which has a plant community dominated by Cupressaceae, often swamp cypresses. Swamp cypresses typically belong to the genus Taxodium or the species Glyptostrobus pensilis and Actinostrobus pyramidalis." ;
    :has_exact_synonym "cypress dome swamp" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cypress_strand_swamp rdfs:subClassOf :strand_swamp ;
    :has_definition "A cypress strand swamp is a strand swamp which has a plant community dominated by Cupressaceae, often swamp cypresses. Swamp cypresses typically belong to the genus Taxodium or the species Glyptostrobus pensilis and Actinostrobus pyramidalis." ;
    :has_exact_synonym "cypress strand" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cypress_swamp rdfs:subClassOf :swamp_ecosystem ;
    :has_definition "A cypress swamp is a swamp which has a plant community dominated by Cupressaceae, often swamp cypresses. Swamp cypresses typically belong to the genus Taxodium or the species Glyptostrobus pensilis and Actinostrobus pyramidalis." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gravelly_slope rdfs:subClassOf [ a owl:Restriction ;
