            owl:onProperty :has_quality ;
            owl:someValuesFrom :herbaceous ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :forest_ecosystem ;
                            rdf:rest [ rdf:first :woodland_ecosystem ;
                                    rdf:rest :nil ] ] ] ],
        :vegetation_layer ;
    :has_definition "A herb and fern layer is a layer of a forest or woodland which is composed of all vascular plant life that are one metre or less in height."^^xsd:string ;
    :has_exact_synonym "fern layer"^^xsd:string,
        "herb layer"^^xsd:string,
        "herb stratum"^^xsd:string,
        "herbaceous layer"^^xsd:string,
        "herbaceous stratum"^^xsd:string,
        "herbaceous understory"^^xsd:string ;
    :has_related_synonym "ground cover"^^xsd:string,
        "ground vegetation"^^xsd:string,
        "regeneration layer"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:litter_layer rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :plant_litter ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :forest_ecosystem ;
                            rdf:rest [ rdf:first :woodland_ecosystem ;
                                    rdf:rest :nil ] ] ] ],
        :caro_0000000,
        :vegetation_layer ;
    :has_exact_synonym "ground layer"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

