@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ice_cap_climatic_condition rdfs:subClassOf :polar ;
    :has_definition "An ice cap climatic condition is a polar condition in which the montly average temperature does not exceed 0 degrees Celsius."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:vegetation_layer rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :viridiplantae ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :ecosystem ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_part ;
                                            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :ecological_community ;
                                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                            owl:onProperty :composed_primarily_of ;
                                                                            owl:someValuesFrom :viridiplantae ] ;
                                                                    rdf:rest :nil ] ] ] ] ;
                                    rdf:rest :nil ] ] ] ],
        :layer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :layer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom :viridiplantae ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A layer which is determined by a form of vegetation."^^xsd:string ;
    :has_related_synonym "forest layer"^^xsd:string,
        "forest stratum"^^xsd:string,
        "woodland layer"^^xsd:string,
        "woodland stratum"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:granite rdfs:subClassOf :igneous_rock ;
    :has_definition "A portion of granite is a portion of igneous  rock which  is intrusive, felsic, granular, and phaneritic."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
