            owl:onProperty :has_quality ;
            owl:someValuesFrom :alkaline ],
        :liquid_water ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :liquid_water ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_quality ;
                                    owl:someValuesFrom :alkaline ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A portion of alkaline water is a portion of water with a pH greater than 7."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:acidic_water rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :acidic ],
        :liquid_water ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :liquid_water ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_quality ;
                                    owl:someValuesFrom :acidic ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A portion of acidic water is a portion of water with a pH less than 7."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

