@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:solutional_cave rdfs:subClassOf :cave ;
    :has_definition "A cave formed by the dissolution of soluble rock or other solid material such as limestone, chalk, dolomite, gypsum, salt or marble."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:primary_cave rdfs:subClassOf :cave ;
    :has_definition "A cave formed at the same time as the surrounding rock."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:inflationary_cave rdfs:subClassOf :volcanic_cave ;
    :has_definition "A cave that is formed by the action of pressurised lava pushing against surrounding rock and then draining away."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:erosional_cave rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :planetary_erosion ],
        :cave ;
    :has_definition "A cave formed by erosion caused by flowing streams carrying rocks or sediments."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:glacier_cave rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :located_in ;
            owl:someValuesFrom :glacier ],
        :cave ;
    :has_definition "A glacier cave is a cave formed within or under a glacier."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ice_cave rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :location_of ;
            owl:someValuesFrom :ice_mass ],
        :cave ;
    :has_definition "An ice cave is a bedrock cave which contains year-round ice formations."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:talus_cave rdfs:subClassOf :cave ;
    :has_definition "A talus cave is a cave formed by the openings between large boulders which have fallen into a random heap."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:anchialine_cave rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :anchialine_pool ],
        :cave ;
    :has_definition "An anchialine cave is a cave which contains an anchialine pool."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:anchialine_pool rdfs:subClassOf :pond ;
    :has_definition "An anchialine pool is a landlocked water body with a subterranean connection to the ocean and which has fresh water towards its surface with saline water in its deeper layers."^^xsd:string ;
    :has_exact_synonym "anchialine pond"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:vadose_cave rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :vadose_zone ],
        :cave ;
    :has_definition "A cave which is within a vadose zone."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:tundra_climatic_condition rdfs:subClassOf :environmental_condition ;
    :has_definition "An tundra climatic condition is a polar condition in which at least one month's average temperature exceeds 0 degrees Celsius."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:agricultural_waste_material rdfs:subClassOf :waste_material ;
    :has_broad_synonym "agricultural waste" ;
    :has_definition "Agricultural waste is waste produced as a result of various agricultural operations. It includes manure and other wastes from farms, poultry houses and slaughterhouses; harvest waste; fertilizer run- off from fields; pesticides that enter into water, air or soils; and salt and silt drained from fields."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:household_waste_material rdfs:subClassOf :waste_material ;
    :has_broad_synonym "household waste" ;
    :has_definition "Household waste refers to waste material usually generated in the residential environment. Waste with similar characteristics may be generated in other economic activities and can thus be treated and disposed of together with household waste."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:biological_waste_material rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :organic_waste_material ],
        :waste_material ;
    :has_broad_synonym "biological waste" ;
    :has_definition "Biological waste is waste containing mostly natural organic materials (remains of plants, animal excrement, biological sludge from waste-water treatment plants and so forth)."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:dry_woodland rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :tropical_marine_condition ],
        :tropical_environment,
        :woodland_ecosystem ;
    :has_definition "A dry woodland is a woodland which occurs in areas of rain shadow in a tropical marine climate,  receives very little rainfall,  typically has rapidly draining soils and trees which have adaptations to dry climates such as thick bark, small leaves, and the disposition to shed their leaves."^^xsd:string ;
    :has_exact_synonym "xerophytic ecosystem"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:tropical_marine_condition rdfs:subClassOf :tropical ;
    :has_definition "A tropical marine condition is a tropical condition in which the ocean strongly influences the climate and a wet and dry season occur."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:tropical_marine_semi_evergreen_forest rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :semi_deciduous_plant_ ],
        [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :tropical_marine_condition ],
        :tropical_forest ;
    :has_broad_synonym "semi-evergreen forest"^^xsd:string ;
    :has_definition "A semi-evergreen forest is a forest which undergoes a long dry season and, as a consequence, has a two-storey layer structure,  a dry canopy, a leaf litter layer that only decays during moist periods trees with very small leaves or which shed their leaves to conserve water and which flower during the dry season and grow during the wet season."^^xsd:string ;
    :has_exact_synonym "mesophytic ecosystem"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:humid_subtropical rdfs:subClassOf :subtropical ;
    :has_definition "A humid subtropical condition is a subtropical condition in which an environmental system has hot, humid summers, warm to cool dry winters, and average annual precipitation either evenly distributed throughout the year or marked by a dry season or drying trend during winter"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:arid_subtropical rdfs:subClassOf :subtropical ;
    :has_definition "An arid subtropical condition is a subtropical condition in which an environmental system has an annual average temperature near 18.2 degrees Celsius with their coldest month averaging between 2 and 13 degrees Celsius, the absence of regular rainfall, and high humidity."^^xsd:string ;
    :has_exact_synonym "desert climate"^^xsd:string,
        "semi-desert climate"^^xsd:string ;
    :has_related_synonym "semi-arid climate"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:highland_subtropical rdfs:subClassOf :subtropical ;
    :has_definition "A highland subtropical condition is a subtropical condition in which increased elevation results in mild summers, cooler winters, and, in some instances,  snowfall associated with montly temperature averages below 22 but above -3 degrees Celsius."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:oceanic_temperate rdfs:subClassOf :temperate ;
    :has_definition "An oceanic temperate condition is a temperate condition which is strongly influenced by oceans and oceanic winds. Summers are cool and winters are cool, but not cold, and there is little frozen precipitation at lower elevations."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:continental_temperate rdfs:subClassOf :temperate ;
    :has_definition "A continental temperate condition is a temperate condition which is influenced by large land masses. Summers are warm to hot and winters are often  long, cold, and snowy."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:cold_desert rdfs:subClassOf :desert_area ;
    :has_definition "A cold desert is a desert which has hot summers and cold, dry winters with temperatures below 0 degrees Celsius"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:temperate_evergreen_needleleaf_forest rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :evergreen_plant_ ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :temperate_coniferous_forest_biome ],
        :needleleaf_forest,
        :temperate_forest ;
    :has_broad_synonym "coniferous forest"^^xsd:string ;
    :has_definition "An evergreen needleleaf forest which is subject to temperate climate patterns." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tropical_lowland_evergreen_broadleaf_rain_forest rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :evergreen_plant_ ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :tropical_moist_broadleaf_forest_biome ],
        :tropical_moist_broadleaf_forest ;
    :has_definition "A broadleaf forest which is subject to tropical climate patterns with high rainfall, is located in a lowland area, and is dominated by plants which retain their leaves throughout the year." ;
    :has_related_synonym "rain forest" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

