@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:temperate_deciduous_needleleaf_forest rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :deciduous_plant_ ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :temperate_coniferous_forest_biome ],
        :needleleaf_forest,
        :temperate_forest ;
    :has_broad_synonym "coniferous forest"^^xsd:string ;
    :has_definition "A deciduous needleleaf forest which is subject to temperate climate patterns." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tropical_deciduous_broadleaf_forest rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :deciduous_plant_ ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :tropical_broadleaf_forest_biome ],
        :tropical_broadleaf_forest ;
    :has_definition "A deciduous broadleaf forest which is subject to tropical climate patterns." ;
    :has_related_synonym "rain forest" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tropical_semi_deciduous_broadleaf_forest rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :semi_deciduous_plant_ ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :tropical_broadleaf_forest_biome ],
        :tropical_broadleaf_forest ;
    :has_definition "A semi-deciduous broadleaf forest which is subject to tropical climate patterns." ;
    :has_related_synonym "rain forest" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
