    :has_related_synonym "coniferous forest"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tropical_semi_evergreen_moist_broadleaf_forest rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :tropical_moist_broadleaf_forest_biome ],
        [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :semi_deciduous_plant_ ],
        :tropical_moist_broadleaf_forest ;
    :has_related_synonym "rain forest" .

