:tropical_sclerophyllous_dry_forest rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :arid ],
        :sclerophyllous_forest,
        :tropical_forest ;
    :has_definition "A sclerophyllous forest which is subject to tropical climate patterns." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

