                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_quality ;
                                    owl:someValuesFrom :evergreen_plant_ ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A broadleaf evergreen forest which is subject to temperate climate patterns." .

