:tropical_mixed_broadleaf_forest rdfs:subClassOf :tropical_mixed_forest ;
    :has_definition "A tropical mixed broadleaf forest which has communities of trees composed primarily of species with broad leaves." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

