        :amorphous_solid ;
    :has_definition "A portion of respirable suspended particulate matter is a form of particulate matter composed primarily of solid particles each with a diameter of 10 micrometers or less." ;
    :has_exact_synonym "PM10" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
