            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :water_ice ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :air ],
        [ a owl:Restriction ;
            owl:onProperty :output_of ;
            owl:someValuesFrom :snowfall ],
        [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :object_aggregate ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_member ;
                                            owl:someValuesFrom :snow_crystal ] ;
                                    rdf:rest :nil ] ] ] ],
        :environmental_material ;
