                            rdf:rest [ rdf:first :freshwater_river ;
                                    rdf:rest :nil ] ] ] ],
        :littoral_zone ;
    :has_definition "A freshwater littoral zone is a littoral zone which extends offshore from the shore of a freshwater body of water to the limit of occupancy of rooted plants."^^xsd:string ;
    :has_related_synonym "fringing wetland"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:marine_eulittoral_zone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :marine_supra_littoral_zone ;
                            rdf:rest [ rdf:first :marine_sub_littoral_zone ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :marine_littoral_zone ],
        :marine_environmental_zone ;
    :has_definition "The eulittoral zone extends from the spring high tide line, which is rarely inundated, to the spring low tide line, which is rarely not inundated. The wave action and turbulence of recurring tides shapes and reforms cliffs, gaps, and caves, offering a huge range of habitats for sedentary organisms."^^xsd:string ;
    :has_related_synonym "foreshore"^^xsd:string,
        "intertidal zone"^^xsd:string,
        "mediolittoral zone"^^xsd:string,
        "midlittoral zone"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:infralittoral_zone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :marine_sub_littoral_zone ],
        :marine_environmental_zone ;
    :has_definition "A zone which is part of the sublittoral zone and is dominated by algae. This zone usually extends up to five metres below the low water mark."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:circalittoral_zone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :marine_sub_littoral_zone ],
        :marine_environmental_zone ;
    :has_definition "A zone which is part of the sublittoral zone and is dominated by sessile animals such as oysters. This zone usually begins at a depth greater than the infralittoral zone."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:old_plant rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :old ],
        :whole_plant ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :whole_plant ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_quality ;
                                    owl:someValuesFrom :old ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A whole plant which is relatively old"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:young_plant rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :young ],
        :whole_plant ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :whole_plant ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_quality ;
                                    owl:someValuesFrom :young ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A whole plant which is relatively young."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fine_respirable_suspended_particulate_matter rdfs:subClassOf :respirable_suspended_particulate_matter ;
    :has_definition "A portion of fine respirable suspended particulate matter is a form of particulate matter composed primarily of solid particles each with a diameter of 2.5 micrometers or less." ;
    :has_exact_synonym "PM2.5" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ultrafine_respirable_suspended_particulate_matter rdfs:subClassOf :fine_respirable_suspended_particulate_matter ;
    :has_definition "A portion of fine respirable suspended particulate matter is a form of particulate matter composed primarily of solid particles each with a diameter of  100 nanometers or less." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:house rdfs:subClassOf :building ;
    :has_definition "A house is a building that provides a dwelling-place for a living entity."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:human_house rdfs:subClassOf :domestic_building,
        :house .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:domestic_garden rdfs:subClassOf :garden ;
    :has_definition "A garden that is associated with a human house. This association is generally one of spatial proximity or parthood."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:building_part rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :building ],
        :human_construction ;
    :has_definition "A building part is a construction which is part of a building."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:indoor_kitchen rdfs:subClassOf :building_part ;
    :has_definition "An indoor kitchen is a room or part of a room primarily used  for cooking or food preparation, but which may have other funcitons such as dining, food storage, dishwashing, or laundry."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:bathroom rdfs:subClassOf :room ;
    :has_definition "A bathroom is a room which contains a washbasin or other fixture, such as a shower or bath, used for bathing by humans."^^xsd:string ;
    :has_exact_synonym "bathing room"^^xsd:string ;
    :has_related_synonym "toilet"^^xsd:string,
        "washroom"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:living_room rdfs:subClassOf :room ;
    :has_definition "A living room is a room in a human house which is used for social and domestic leisure activities."^^xsd:string ;
    :has_exact_synonym "living-room"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:patio rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :human_house ],
        :human_construction ;
    :has_definition "A patio is a paved outdoor area, adjacent to a human house, and used for dining or recreation."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:indoor_toilet rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :toilet_fixture ],
        :room ;
    :has_broad_synonym "toilet"^^xsd:string,
        "restroom"@en ;
    :has_definition "An indoor toilet is a room which contains a sanitation fixture used primarily for the disposal of human urine and faeces."^^xsd:string ;
    :has_exact_synonym "indoor lavatory"^^xsd:string,
        "lavatory"^^xsd:string,
        "toilet room"^^xsd:string ;
    :has_related_synonym "bathroom"^^xsd:string,
        "restroom"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:room rdfs:subClassOf :building_part ;
    :has_definition "A building part which is separated from other building parts by one or more interior walls and, optionally, outdoor areas by one or more exterior walls."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:carbon_nanotube_enriched_soil rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_increased_levels_of ;
            owl:someValuesFrom :carbon_nanotube ],
        :enriched_soil ;
    :has_definition "A portion of carbon nanotube enriched soil is a portion of soil with elevated levels of carbon nanotubes."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:area_of_rocky_shore rdfs:subClassOf :intertidal_zone ;
    :has_definition "A rocky shore is an intertidal area of a seacoast where solid rock is the predominant substrate."^^xsd:string ;
    :has_related_synonym "rocky intertidal shore"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:burrow rdfs:subClassOf :tunnel ;
    :has_definition "A burrow is a hole or tunnel excavated into the ground by an animal to create a space suitable for habitation, temporary refuge, or as a byproduct of locomotion"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:broadleaf_forest rdfs:subClassOf :forest_ecosystem ;
    :has_definition "A forest biome which contains densely packed populations or communities of broadleaf trees, strongly limiting light penetration to the forest floor." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mixed_forest rdfs:subClassOf :forest_ecosystem ;
    :has_definition "A forest ecosystem which contains densely packed populations or communities of broadleaf and coniferous trees, strongly limiting light penetration to the forest floor." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:swamp_forest rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :swamp_ecosystem ],
        :forest_ecosystem .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:needleleaf_forest rdfs:subClassOf :forest_ecosystem ;
    :has_exact_synonym "coniferous forest"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:montane_forest rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :alpine ;
                            rdf:rest [ rdf:first :montane ;
                                    rdf:rest :nil ] ] ] ],
        :forest_ecosystem ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :forest_ecosystem ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_quality ;
                                    owl:someValuesFrom [ owl:unionOf [ rdf:first :alpine ;
                                                    rdf:rest [ rdf:first :montane ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ] .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:waterborne_particulate_matter rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :solid_environmental_material ],
        [ a owl:Restriction ;
            owl:onProperty :surrounded_by ;
            owl:someValuesFrom :liquid_water ],
        :particulate_environmental_material ;
    :has_definition "Particulate environmental material in which small portions of solid material are surrounded by water."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:lava_field rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :lava_flow ],
        :field ;
    :has_definition "A lava field is an expanse of flat-lying lava flows. Such features are generally composed of highly fluid basalt lava, and can extend for tens or even hundreds of miles across the underlying terrain."^^xsd:string ;
    :has_exact_synonym "lava area"^^xsd:string,
        "lava bed"^^xsd:string,
        "lava plain"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:lava_flow rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :effusive_eruption ],
        [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :lava ],
        :body_of_liquid ;
    :has_definition "A lava flow is a moving outpouring of lava, which is created during a non-explosive effusive eruption."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:andesitic_volcano rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :volcanic_eruption ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_output ;
                                            owl:someValuesFrom :intermediate_lava ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :andesite ],
        :volcano ;
    :has_definition "A volcano which has been formed as a result of the eruption of andesitic lava."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dacitic_volcano rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :dacite ],
        [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :volcanic_eruption ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_output ;
                                            owl:someValuesFrom :dacitic_lava ] ;
                                    rdf:rest :nil ] ] ] ],
        :volcano ;
    :has_definition "A volcano which has been formed as a result of the eruption of dacitic lava."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:andesite rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :intermediate_lava ],
        :igneous_rock ;
    :has_definition "Andesite is an extrusive igneous, volcanic rock, of intermediate composition, with aphanitic to porphyritic texture."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:dacite rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :dacitic_lava ],
        :igneous_rock ;
    :has_definition "Dacite is an igneous, volcanic rock. It has an aphanitic to porphyritic texture and is intermediate in composition between andesite and rhyolite.  Dacite consists mostly of plagioclase feldspar with biotite, hornblende, and pyroxene (augite and/or enstatite). It has quartz as rounded, corroded phenocrysts, or as an element of the ground-mass. The plagioclase ranges from oligoclase to andesine and labradorite. Sanidine occurs, although in small proportions, in some dacites, and when abundant gives rise to rocks that form transitions to the rhyolites."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:salt_mass rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :salt_material ],
        :solid_astronomical_body_part ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :solid_astronomical_body_part ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom :salt_material ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An accumulation of a salt, typically sodium chloride." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dacitic_lava rdfs:subClassOf :lava ;
    :has_definition "Lava which is high in silica and low in alkali metal oxides."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:disturbed_ecosystem rdfs:subClassOf :ecosystem ;
    :has_definition "An ecosystem which has been subject to a perturbation, that is, the ecosystem has undergone a pronounced change in response to a change in environmental conditions or other perturbation."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ravine rdfs:subClassOf :valley ;
    :has_definition "A ravine is a small, narrow, steep-sided valley that is larger than a gully and smaller than a canyon and that is usually worn by running water."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:roadside rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :road ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :landmass ],
        :environmental_zone ;
    :has_definition "An environmental zone of varying area which is adjacent to a road."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:mixed_grassland rdfs:subClassOf :grassland_ecosystem ;
    :has_broad_synonym "mixed grassland" ;
    :has_definition "A grassland which contains a mixture of tall and short grasses."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:wet_meadow_ecosystem rdfs:subClassOf :meadow_ecosystem ;
    :has_definition "A wet meadow is a type of wetland with soils that are saturated with water for part or all of the growing season."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:salt_glacier rdfs:subClassOf :salt_mass,
        :surface_landform ;
    :has_definition "A mass of salt which has erupted onto a planetary surface, usually through sedimentary rock." ;
    :has_exact_synonym "namakier",
        "salt fountain" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:atmospheric_carbon_dioxide rdfs:subClassOf [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :part_of ;
                            owl:someValuesFrom :atmosphere ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom :carbon_dioxide ] ;
                            rdf:rest :nil ] ] ],
        :gaseous_environmental_material ;
    :has_definition "Atmospheric carbon dioxide is an environmental material composed of carbon dioxide in its gaseous form present in an atmosphere." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:environmental_disposition rdfs:subClassOf :disposition ;
    :has_definition "A disposition which is realised by an environmental system or system parts thereof." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:carbon_pooling_disposition rdfs:subClassOf :material_pooling_disposition ;
    :has_definition "The disposition of an environmental system to sequester and store carbon." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:carbon_dioxide_pooling_disposition rdfs:subClassOf :carbon_pooling_disposition ;
    :has_definition "The disposition of an environment to sequester carbon dioxide, subsequently storing the carbon component thereof." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:material_pooling_disposition rdfs:subClassOf :environmental_disposition ;
    :has_definition "The disposition of an environmental system to sequester and store some material entity." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:concrete_masonry_unit rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :concrete ],
        :masonry_unit ;
    :has_definition "A concrete masonry unit is a large, rectangular masonry unit primarily composed of concrete."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:masonry_unit rdfs:subClassOf :manufactured_product ;
    :has_definition "A masonry unit is a solid piece of material, usually with a regular shape, used as a component in the construction of buildings. Masonry units are usually composed of brick, stone, marble, granite, travertine, limestone, cast stone, concrete block, glass block, stucco, tile, or cob."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:concrete rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :masonry_cement ],
        :anthropogenic_environmental_material ;
    :has_definition "Concrete is a composite material composed of an aggregate bonded together with a fluid cement which hardens over time."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:asphalt_concrete rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :refined_asphalt ],
        :concrete ;
    :has_definition "Asphaltic concrete is a concrete which uses refined asphalt as a cement."^^xsd:string ;
    :has_exact_synonym "asphaltic concrete"^^xsd:string,
        "road pavement"^^xsd:string .

