        :building_part ;
    :has_definition """A building envelope is a building part composed of those building parts which physically separate the interior of a building from its surrounding environment.
The building envelope provides resistance to air, water, heat, light, and noise transfer. The three basic elements of a building envelope are a weather barrier, air barrier, and thermal barrier."""^^xsd:string ;
    :has_related_synonym "building enclosure"^^xsd:string .

