:batholith rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :igneous_intrusion_process ;
                            rdf:rest [ rdf:first :planetary_erosion ;
                                    rdf:rest :nil ] ] ] ],
        :igneous_intrusion ;
    :has_definition "A batholith is an area of mostly continuous plutonic (igneous intrusive) rock that covers an area larger than 100 square kilometers, formed in the planetary crust, and exposed by erosion. On Earth, Batholiths are almost always made mostly of felsic or intermediate rock-types, such as granite, quartz monzonite, or diorite." .

