        "latrine covering"^^xsd:string,
        "latrine shelter"^^xsd:string ;
    :has_related_synonym "dunny"^^xsd:string,
        "privy"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rock_intrusion rdfs:subClassOf [ a owl:Restriction ;
