    :has_broad_synonym "flush toilet"^^xsd:string,
        "toilet"^^xsd:string ;
    :has_definition "A flush toilet fixture into which water is manually poured to dispose of excreta."^^xsd:string ;
    :has_exact_synonym "pour flush toilet fixture"^^xsd:string ;
    :has_related_synonym "bog"^^xsd:string,
        "comfort room"^^xsd:string,
        "dunny"^^xsd:string,
        "head"^^xsd:string,
        "john"^^xsd:string,
        "lavatory"^^xsd:string,
        "loo"^^xsd:string,
        "pot"^^xsd:string,
        "the heads"^^xsd:string,
        "water closet"^^xsd:string .

