    :has_broad_synonym "toilet"^^xsd:string ;
    :has_definition "A pit latrine which includes a water seal (U-trap or siphon) used over one or two offset pits instead of a plain hole or seat. Water is manually poured through the trap to flush excreta into the latrine pit."^^xsd:string ;
    :has_related_synonym "bog"^^xsd:string,
        "dunny"^^xsd:string,
        "head"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:factory rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :industrial_building ],
        :industrial_building ;
    :has_definition "A factory (previously manufactory) or manufacturing plant is an industrial site, usually consisting of buildings and machinery, or more commonly a complex having several buildings, where workers manufacture goods or operate machines processing one product into another." ;
    :has_exact_synonym "manufactory",
        "manufacturing plant" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:atmospheric_ozone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :atmosphere ],
        [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :ozone ],
        :gaseous_environmental_material ;
    :has_definition "Atmospheric ozone is an environmental material primarily composed of ozone in its gaseous form and present in an atmosphere." ;
    :has_related_synonym "atmospheric ozone" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:stratosphere rdfs:subClassOf [ owl:intersectionOf [ rdf:first [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :adjacent_to ;
                                            owl:someValuesFrom :mesosphere ] ;
                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                    owl:onProperty :adjacent_to ;
                                                    owl:someValuesFrom :troposphere ] ;
                                            rdf:rest :nil ] ] ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :part_of ;
                                    owl:someValuesFrom :atmosphere ] ;
                            rdf:rest :nil ] ] ],
        :atmospheric_layer ;
    :has_definition "The layer of the atmosphere which is sandwiched between the troposphere and mesosphere. Of the energy that reaches the Earth from the sun, only 3% is absorbed in the stratosphere, but that includes the vitally important process of absorption of ultraviolet radiation by the stratospheric ozone layer. The stratosphere is cloudless and dust free, and almost unaffected by the turbulent conditions of the underlying level of the atmosphere. (Source: WRIGHT)" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mesosphere rdfs:subClassOf [ owl:intersectionOf [ rdf:first [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :adjacent_to ;
                                            owl:someValuesFrom :stratosphere ] ;
                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                    owl:onProperty :adjacent_to ;
                                                    owl:someValuesFrom :thermosphere ] ;
                                            rdf:rest :nil ] ] ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :part_of ;
                                    owl:someValuesFrom :atmosphere ] ;
                            rdf:rest :nil ] ] ],
        :atmospheric_layer ;
    :has_definition "The mesosphere is part of the earth's atmosphere which is between the stratosphere and the thermosphere in which temperature decreases with altitude to the atmosphere's absolute minimum" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:troposphere rdfs:subClassOf [ owl:intersectionOf [ rdf:first [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :adjacent_to ;
                                            owl:someValuesFrom :planetary_surface ] ;
                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                    owl:onProperty :adjacent_to ;
                                                    owl:someValuesFrom :stratosphere ] ;
                                            rdf:rest :nil ] ] ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :part_of ;
                                    owl:someValuesFrom :atmosphere ] ;
                            rdf:rest :nil ] ] ],
        :atmospheric_layer ;
    :has_definition "The lowest of the concentric layers of the atmosphere, occurring between the Earth's surface and the tropopause. It is the zone where atmospheric turbulence is at its greatest and where the bulk of the Earth's weather is generated. It contains almost all the water vapour and aerosols and three-quarters of the total gaseous mass of the atmosphere. Throughout the troposphere temperature decreases with height at a mean rate of 6.5°C/km and the whole zone is capped by either an inversion of temperature or an isothermal layer at the tropopause. (Source: WHIT)" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:thermosphere rdfs:subClassOf [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :part_of ;
                            owl:someValuesFrom :atmosphere ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :adjacent_to ;
                                    owl:someValuesFrom :mesosphere ] ;
                            rdf:rest :nil ] ] ],
        :atmospheric_layer ;
    :has_definition "The thermosphere is a part of the earth's atmosphere that begins at about 50 miles (80 kilometers) above the earth's surface, extends to outer space, and is characterized by steadily increasing temperature with height" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ozone_layer rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_increased_levels_of ;
            owl:someValuesFrom :ozone ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :stratosphere ],
        :atmospheric_layer ;
    :has_definition "The ozone layer is a layer of gases in the stratosphere which contains high concentrations of ozone gas relative to other parts of the atmosphere." ;
    :has_exact_synonym "ozone shield" ;
    :has_related_synonym "ozone layer" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:atmospheric_layer rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :atmosphere ],
        [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :gaseous_environmental_material ],
        :fluid_layer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :fluid_layer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :part_of ;
                                    owl:someValuesFrom :atmosphere ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A layer that is part of the atmosphere." ;
    :has_related_synonym "atmospheric layering" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:boundary_layer rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :bounding_layer_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :material_entity ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :part_of ;
                                            owl:someValuesFrom :environmental_system ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :surface_layer ],
        :fluid_interface_layer ;
    :has_definition "A boundary layer is a layer of fluid in the immediate vicinity of a bounding surface where the effects of viscosity are significant enough to distort the surrounding non-viscous flow." ;
    :has_exact_synonym "boundary layer" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ionosphere rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ a owl:Restriction ;
                    owl:onProperty :part_of ;
                    owl:someValuesFrom :mesosphere ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :thermosphere ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ a owl:Restriction ;
                    owl:onProperty :part_of ;
                    owl:someValuesFrom :exosphere ] ],
        :atmospheric_layer ;
    :has_definition "The ionosphere is a layer of the Earth's atmosphere which extends from about 60 to 1,000 kilometers above the planetary surface and is ionised by solar radiation. It includes the thermosphere and parts of the mesosphere and exosphere." ;
    :has_related_synonym "ionosphere" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:exosphere rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :thermosphere ],
        :atmospheric_layer ;
    :has_definition "The exosphere is an atmospheric layer where molecules are gravitationally bound to a planetary body, but where their density is too low for them to behave as a gas by colliding with each other. In the case of bodies with substantial atmospheres, such as Earth's atmosphere, the exosphere is the uppermost layer, where the atmosphere thins out and merges with interplanetary space. It is located directly above the thermosphere." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:glaze_ice_layer rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :freezing_rainfall ],
        :water_ice_layer ;
    :has_broad_synonym "glaze" ;
    :has_definition "A glaze ice layer is a smooth, transparent and homogeneous ice layer which coats some surface and which is formed when freezing rain or drizzle hits that surface." ;
    :has_related_synonym "glaze",
        "glaze ice" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:eutrophic_lake rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :eutrophic_water ],
        :lake ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :lake ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom :eutrophic_water ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A lake which has nutrient-rich water." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:composting_toilet rdfs:subClassOf :dry_toilet_fixture ;
    :has_definition "A composting toilet fixture is a dry toilet fixture in which managed, aerobic decomposition converts human excreta into organic matter suitable for the fertilisation or amendment of soils." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:paraffin_oil rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :alkane ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :naphthalene ;
                            rdf:rest [ rdf:first :alkane ;
                                    rdf:rest :nil ] ] ] ],
        :fuel_oil ;
    :has_broad_synonym "paraffin" ;
    :has_definition "A fuel oil which is 1) composed primarily of alkanes having between 5-15 carbon atoms with the general formula CnH2n+2, 2) is generally odorless or has only a slight odor, 3) produces only small amounts of soot relative to other fuel oils, 4) is highly refined." ;
    :has_exact_synonym "liquid paraffin" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:natural_gas rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_role ;
            owl:someValuesFrom :fossil_fuel ],
        [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :methane ],
        :hydrocarbon_gas ;
    :has_definition "Natural gas is a hydrocarbon gas mixture consisting primarily of methane, but commonly includes varying amounts of other higher alkanes and sometimes a usually lesser percentage of carbon dioxide, nitrogen, and/or hydrogen sulfide. Natural gas is a fossil fuel formed when layers of buried plants and gases are exposed to intense heat and pressure over thousands of years." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:liquefied_petroleum_gas rdfs:subClassOf :liquefied_hydrocarbon_gas ;
    :has_definition "Liquified petroleum gas or liquid petroleum gas (LPG or LP gas), also referred to as simply propane or butane, are flammable mixtures of hydrocarbon gases used as fuel in heating appliances, cooking equipment, and vehicles." ;
    :has_exact_synonym "LP gas",
        "LPG",
        "liquid petroleum gas" ;
    :has_related_synonym "liquified natural gas" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hydrocarbon_gas rdfs:subClassOf :gaseous_environmental_material,
        :hydrocarbon_based_environmental_material ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :gaseous_environmental_material ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_quality ;
                                    owl:someValuesFrom :quality_of_a_gas ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :composed_primarily_of ;
                                            owl:someValuesFrom :hydrocarbon ] ;
                                    rdf:rest :nil ] ] ] ] ;
    :has_definition "A gas that is primarily composed of hydrocarbon molecules." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:compressed_natural_gas rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :increased_pressure ],
        :natural_gas ;
    :has_definition "Compressed natural gas is a natural gas stored at high pressures, typically 20–25 Megapascals." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:biogas rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :methane ;
                            rdf:rest [ rdf:first :carbon_dioxide ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :methane ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :carbon_dioxide ],
        :hydrocarbon_gas ;
    :has_definition "Biogas is a mixture of different gases produced by the breakdown of organic matter in the absence of oxygen,  is primarily composed of methane and carbon dioxide, and may have small amounts of hydrogen sulfide, water, and siloxanes." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:liquefied_natural_gas rdfs:subClassOf :liquefied_hydrocarbon_gas ;
    :has_definition "Liquefied natural gas (LNG) is natural gas (predominantly methane, CH4) that has been converted to liquid form for ease of storage or transport. It takes up about 1/600th the volume of natural gas in the gaseous state. It is odorless, colorless, non-toxic and non-corrosive. LNG achieves a higher reduction in volume than compressed natural gas (CNG) so that the (volumetric) energy density of LNG is 2.4 times greater than that of CNG or 60 percent of that of diesel fuel." ;
    :has_exact_synonym "LNG",
        "liquified natural gas" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:liquefied_hydrocarbon_gas rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :condensed ],
        [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :increased_pressure ],
        :hydrocarbon_based_environmental_material,
        :liquid_environmental_material .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:compressed_biogas rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :increased_pressure ],
        :biogas ;
    :has_definition "Compressed biogas is biogas stored at increased pressures." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:charcoal rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :output_of ;
            owl:someValuesFrom :pyrolysis ],
        :hydrocarbon_based_environmental_material,
        :organic_material,
        :solid_environmental_material ;
    :has_definition "Charcoal is a light, black residue, consisting of carbon and any remaining ash, obtained by removing water and other volatile constituents from animal and vegetation substances. Charcoal is usually produced by slow pyrolysis, the heating of wood or other substances in the absence of oxygen." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:paraffin_lamp rdfs:subClassOf :lamp ;
    :has_definition "A paraffin lamp is a type of lighting device which burns paraffin to generate light and heat." ;
    :has_exact_synonym "kerosene lamp" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:flat_wick_lamp rdfs:subClassOf :paraffin_lamp ;
    :has_definition "A flat-wick lamp is a simple type of paraffin lamp, which burns paraffin drawn up through a wick by capillary action." ;
    :has_exact_synonym "flat wick lamp" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:central_draught_lamp rdfs:subClassOf :paraffin_lamp ;
    :has_definition "A central-draught lamp is a paraffin lamp which burns a parrafin saturated, tubular wick contained between two structural tubes and supplied with oxygen by a central draught of air through the innermost of these tube." ;
    :has_exact_synonym "Argand lamp",
        "central draught lamp",
        "tubular round wick lamp" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mantle_lamp rdfs:subClassOf :central_draught_lamp ;
    :has_definition "A mantle lamp is a central-draught lamp which includes a pear-shaped, fabric mesh containing thorium or other rare-earth salts placed over the burner. On first use the fabric burns away and the rare-earth salts are converted to oxides, leaving a very fragile structure which incandesces (glows brightly) upon exposure to the heat of the burner flame." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lantern rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :lamp ],
        :manufactured_product ;
    :has_definition "A lantern is a portable device or mounted fixture comprising a light source protected by a translucent case." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lamp rdfs:subClassOf :manufactured_product ;
    :has_definition "A lamp is an object which generates heat, light, or any other form of radiation." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:paraffin_lantern rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :paraffin_lamp ],
        :lantern ;
    :has_definition "A paraffin lantern is a lantern which houses a parrafin lamp in a structure of soldered or crimped-together sheet metal stampings and glass or other translucent material." ;
    :has_exact_synonym "barn lantern",
        "hurricane lantern",
        "kerosene lantern" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tubular_paraffin_lantern rdfs:subClassOf :paraffin_lantern ;
    :has_definition "A tubular paraffin lantern is a paraffin lantern which includes metal tubes in its casing that direct air to the burning wick." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dead_flame_paraffin_lantern rdfs:subClassOf :paraffin_lantern ;
    :has_definition "A dead-flame paraffin lantern is a paraffin lantern which has a wick housed in a glass globe with airflow channelled upwards by vents below the burning wick and an open chimney above it." ;
    :has_exact_synonym "glass globe lantern" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hot_blast_paraffin_lantern rdfs:subClassOf :tubular_paraffin_lantern ;
    :has_definition "A hot-blast paraffin lantern is a tubular paraffin lantern which collects hot air from the top of the lantern globe and circulates it, through metal tubes, to the burning wick." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cold_blast_paraffin_lantern rdfs:subClassOf :tubular_paraffin_lantern ;
    :has_definition "A cold-blast paraffin lantern is a tubular paraffin lantern which collects cool air from around the top of the lantern globe and circulates it, through metal tubes, to the burning wick." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:electric_lamp rdfs:subClassOf :lamp ;
    :has_definition "An electric lamp is a lamp which produces light from electricity." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:battery_powered_electric_lamp rdfs:subClassOf :electric_lamp ;
    :has_definition "A battery-powered electric lamp is an electric lamp which draws its power from a device composed of two or more electrochemical cells that convert stored chemical energy into electrical energy." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:candle rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :wax ],
        :lamp ;
    :has_definition "A candle is a lamp composed of a wax within which an ignitable wick is embedded." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:wax rdfs:subClassOf :environmental_material ;
    :has_definition "A wax is an environmental material which is primarily composed of lipids or other organic compounds that consist of long alkyl chains. Waxes are are malleable near ambient temperatures and melt at approximately 45 degrees Celsius." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:apiary rdfs:subClassOf :agricultural_ecosystem ;
    :has_definition "An apiary is a place where beehives of honey bees are kept and maintained by beekeepers." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:radio_device rdfs:subClassOf :manufactured_product ;
    :has_broad_synonym "radio" ;
    :has_definition "A device capable of receiving and/or transmitting information encoded in electromagnetic radiation through wave modulation." ;
    :has_narrow_synonym "radio receiver",
        "radio transmitter" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cassette_player rdfs:subClassOf :manufactured_product ;
    :has_definition "A cassette deck is a device capable of playing and recording audio compact cassettes." ;
    :has_related_synonym "cassette deck",
        "cassette recorder" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:television_set rdfs:subClassOf :manufactured_product ;
    :has_broad_synonym "television" ;
    :has_definition "A television set is a device that combines a tuner, display, and loudspeakers for the purpose of converting digital or analog information signals into moving images and sound." ;
    :has_exact_synonym "TV",
        "telly",
        "tube" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:telephone rdfs:subClassOf :manufactured_product ;
    :has_definition "A telephone is a telecommunications device which converts sound into electronic signals suitable for transmission via cables or other transmission media, and reconverts such signals into sound waves." ;
    :has_exact_synonym "phone" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mobile_phone rdfs:subClassOf :telephone ;
    :has_definition "A mobile phone is a telephone which transmits sound information to a mobile phone network via radio transmissions." ;
    :has_exact_synonym "cell phone",
        "cellular phone",
        "hand phone" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:landline_telephone rdfs:subClassOf :telephone ;
    :has_definition "A landline telephone is a telephone which is connected to a telephone network with wires through which electronic signals are carried." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:refrigerator rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ a owl:Restriction ;
                    owl:onProperty :location_of ;
                    owl:someValuesFrom :refrigerant ] ],
        :manufactured_product ;
    :has_definition "A refrigerator is a device which consists of a thermally insulated compartment and a mechanical, chemical, or electronic heat pump that transfers heat from the inside of the fridge to its external environment such that the inside of the fridge is cooled to a temperature below the ambient temperature of the room" ;
    :has_exact_synonym "fridge" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:table rdfs:subClassOf :piece_of_furniture ;
    :has_definition "A table is a form of furniture with a flat horizontal upper surface used to support objects, for storage, show, and/or manipulation." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:desk rdfs:subClassOf :table ;
    :has_definition "A desk is a table which is intended for information-manipulation tasks, including writing and use of interactive electronics." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chair rdfs:subClassOf :piece_of_furniture ;
    :has_definition "A chair is a piece of furniture with a raised surface commonly used to seat a single person." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:piece_of_furniture rdfs:subClassOf :manufactured_product ;
    :has_definition "A piece of furniture is a movable object intended to support various human activities such as seating (e.g., chairs, stools and sofas) and sleeping (e.g., beds)." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sofa rdfs:subClassOf :bench ;
    :has_definition "A sofa is a bench which is partially or entirely upholstered, and often fitted with springs and tailored cushions." ;
    :has_exact_synonym "couch",
        "settee" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bench rdfs:subClassOf :piece_of_furniture ;
    :has_definition "A bench is a piece of furniture, on which several people may sit at the same time." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mattress rdfs:subClassOf :piece_of_furniture ;
    :has_definition "A mattress is a mass of material which is able to cushion and support a reclining body and is used as or on a bed." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bed_frame rdfs:subClassOf :piece_of_furniture ;
    :has_definition "A bed frame is a piece of furniture which is used to position a mattress and bed base and may include a means of supporting a canopy." ;
    :has_related_synonym "bedstead" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bed_base rdfs:subClassOf :piece_of_furniture ;
    :has_definition "A bed base is a piece of furniture which supports a mattress." ;
    :has_exact_synonym "bed foundation" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:framed_bed rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :mattress ;
                            rdf:rest [ rdf:first :bed_frame ;
                                    rdf:rest [ rdf:first :bed_base ;
                                            rdf:rest :nil ] ] ] ] ],
        :piece_of_furniture ;
    :has_definition "A framed bed is a piece of furniture which is composed of a mattress supported by a bed base and held in place by a bed frame." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cabinet rdfs:subClassOf :piece_of_furniture ;
    :has_definition "A cabinet is a roughly cuboidal piece of furniture which is used to store miscellaneous items in compartments accessible through doors or drawers." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cupboard rdfs:subClassOf :cabinet ;
    :has_definition "A cupboard is a cabinet which is used indoors to store household objects such as food, crockery, textiles and liquor, and to protect them from dust and dirt" ;
    :has_related_synonym "closet" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:clock rdfs:subClassOf :manufactured_product ;
    :has_definition "A clock is an instrument which may indicate, keep, and/or co-ordinate time." ;
    :has_related_synonym "timepiece" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pressure_lamp rdfs:subClassOf :lamp ;
    :has_definition "A pressure lamp is a portable paraffin or oil lamp in which fuel is forced up into the mantle or burner by air pressure in the reservoir, which can be increased by pumping with a plunger." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:freshwater_spring rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :fresh_water ],
        :spring ;
    :has_definition "A spring through which fresh water flows."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:river_water rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :river ],
        :liquid_water .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rainwater rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :output_of ;
            owl:someValuesFrom :hydrological_precipitation_process ],
        :fresh_water ;
    :has_definition "Rainwater is liquid water which has precipitated in the form of droplets through the condensation of atmospheric water vapour." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:motor_vehicle rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :motor ],
        :vehicle ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :vehicle ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_part ;
                                    owl:someValuesFrom :motor ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A motor vehicle is a vehicle which is propelled by an engine or motor and that does not operate on rails." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:truck rdfs:subClassOf :motor_vehicle ;
    :has_definition "A truck is a motor vehicle which, as its primary funcion, transports cargo rather than human passangers." ;
    :has_exact_synonym "lorry" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:water_truck rdfs:subClassOf :truck ;
    :has_definition "A water truck is a truck which transports water." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vehicle rdfs:subClassOf :manufactured_product ;
    :has_definition "A vehicle is a mobile machine which transports people or cargo." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:car rdfs:subClassOf :motor_vehicle ;
    :has_definition "A car is a wheeled motor vehicle used primarily for the transportation of human passengers. Most definitions of the term specify that cars are designed to run primarily on roads, to have seating for one to eight people, to typically have four wheels, and to be constructed principally for the transport of people rather than goods." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cart rdfs:subClassOf :vehicle ;
    :has_definition "A cart is a vehicle which has two wheels and is designed to transport human passengers or cargo." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:animal_drawn_cart rdfs:subClassOf :cart ;
    :has_definition "An animal-drawn cart is a cart which is attached to one or more working or draught animals." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:boat rdfs:subClassOf :watercraft ;
    :has_definition "A boat is a watercraft of any size which is able to float or plane on water." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:motor_boat rdfs:subClassOf :boat,
        :motor_vehicle ;
    :has_definition "A motor boat is a boat which is propelled by a motor." ;
    :has_exact_synonym "motorised boat",
        "motorized boat" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:motor rdfs:subClassOf :manufactured_product ;
    :has_definition "A motor is a machine designed to convert one or more forms of energy into mechanical energy." ;
    :has_exact_synonym "engine" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bus rdfs:subClassOf :motor_vehicle ;
    :has_definition "A bus is a road vehicle designed to carry many passengers." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:taxicab rdfs:subClassOf :car ;
    :has_definition "A taxicab is a car which may be hired, along with its operator, to transport passengers between locations of their choosing." ;
    :has_exact_synonym "cab",
        "taxi" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:watercraft rdfs:subClassOf :vehicle ;
    :has_definition "A watercraft is a vehicle which is able to travel on or through water." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bicycle rdfs:subClassOf :vehicle ;
    :has_broad_synonym "bike",
        "cycle" ;
    :has_definition "A bicycle is a human-powered, pedal-driven, single-track vehicle, having two wheels attached to a frame, one behind the other." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:motorcycle rdfs:subClassOf :motor_vehicle ;
    :has_broad_synonym "bike",
        "cycle" ;
    :has_definition "A motorcycle is a two- or three-wheeled motor vehicle." ;
    :has_exact_synonym "moto",
        "motorbike" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:motorscooter rdfs:subClassOf :motorcycle ;
    :has_broad_synonym "scooter" ;
    :has_definition "A scooter or motor scooter is a motorcycle with step-through frame and a platform for the rider's feet." ;
    :has_exact_synonym "motor scooter" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lentic_water_body rdfs:subClassOf :water_body ;
    :has_definition "A lentic water body is a water body in which the accumulated water, in its totality, has very little to no directed flow." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lotic_water_body rdfs:subClassOf :water_body ;
    :has_definition "A lotic water body is a water body in which the accumulated water, in its totality, is flowing." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:closed_ecological_system rdfs:subClassOf :vivarium ;
    :has_definition "A closed ecological system is a vivarium which does not rely on matter exchange with any part outside the system." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mesocosm rdfs:subClassOf :vivarium ;
    :has_definition "A mesocosm is a vivarium that is embedded within a natural environment and is used to place a relatively small part of that environment under experimental control for the purposes of scientific investigation." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:microcosm rdfs:subClassOf :vivarium ;
    :has_definition "A microcosm is a vivarium within which a simple ecosystem is artificially established and used to simulate and predict the behaviour of natural ecosystems under controlled conditions." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vaporisation rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_input ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :environmental_material ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :quality_of_a_liquid ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :environmental_material ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :quality_of_a_gas ] ;
                                    rdf:rest :nil ] ] ] ],
        :material_transformation_process ;
    :has_definition "Vaporisation of an element or compound is process whereby that element or compound undergoes a phase transition from the liquid to vapor." ;
    :has_exact_synonym "vaporization" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:boiling rdfs:subClassOf :vaporisation ;
    :has_definition "Boiling is a form of vaporisation which occurs when a liquid is heated to a temperature at which the vapor pressure of the liquid is equal to the pressure exerted on the liquid by the surrounding environmental pressure." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hydrological_condensation_process rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_input ;
            owl:someValuesFrom :atmospheric_water_vapour ],
        [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom :liquid_water ],
        :condensation_process,
        :hydrological_process ;
    :has_broad_synonym "condensation" ;
    :has_definition "Hydrological condensation is a process in which atmospheric water vapour undergoes a phase transition from the gas phase to the liquid phase." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:manufactured_cage rdfs:subClassOf :manufactured_product ;
    :has_broad_synonym "cage" ;
    :has_definition "A manufactured structure made of interspaced structural elements such as metal or wooden bars or wires held together such that they may be used to confine, contain, or protect something." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:drylot rdfs:subClassOf :feedlot ;
    :has_definition "A drylot is an enclosure of limited size usually bare of vegetation and used for fattening livestock." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:feedlot rdfs:subClassOf :agricultural_ecosystem ;
    :has_definition "A feedlot is a plot of land on which livestock are fattened for market" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:plant_litter rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :leaf ],
        [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :dead ],
        :caro_0000000,
        :organic_material ;
    :has_definition "Leaf litter is dead plant material, such as leaves, bark, needles, and twigs, that has fallen to the ground." ;
    :has_exact_synonym "duff",
        "leaf litter",
        "litterfall",
        "soil litter",
        "tree litter" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:climate_change rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_input ;
            owl:someValuesFrom :climate_system ],
        [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :climate_system ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :fluctuating ] ;
                                    rdf:rest :nil ] ] ] ],
        :environmental_system_process ;
    :has_definition "The long-term fluctuations in temperature, precipitation, wind, and all other aspects of the Earth's climate. External processes, such as solar-irradiance variations, variations of the Earth's orbital parameters (eccentricity, precession, and inclination), lithosphere motions, and volcanic activity, are factors in climatic variation. Internal variations of the climate system, e.g., changes in the abundance of greenhouse gases, also may produce fluctuations of sufficient magnitude and variability to explain observed climate change through the feedback processes interrelating the components of the climate system." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acidification_of_an_aquatic_environment rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first [ owl:unionOf [ rdf:first :water_body ;
                                            rdf:rest [ rdf:first :aquatic_biome ;
                                                    rdf:rest [ rdf:first :aquatic_environment ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_part ;
                                            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :liquid_water ;
                                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                            owl:onProperty :has_quality ;
                                                                            owl:someValuesFrom :increased_acidity ] ;
                                                                    rdf:rest :nil ] ] ] ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_input ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :water_body ;
                            rdf:rest [ rdf:first :aquatic_biome ;
                                    rdf:rest [ rdf:first :aquatic_environment ;
                                            rdf:rest :nil ] ] ] ] ],
        :environmental_system_process ;
    :has_definition "Acidification of an aquatic environment is a process whereby the pH of an aquatic environment, biome, or water body is lowered." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ocean_acidification rdfs:subClassOf [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :has_input ;
                            owl:someValuesFrom [ owl:unionOf [ rdf:first :ocean ;
                                            rdf:rest [ rdf:first :sea ;
                                                    rdf:rest :nil ] ] ] ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_output ;
                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first [ owl:unionOf [ rdf:first :ocean ;
                                                                    rdf:rest [ rdf:first :sea ;
                                                                            rdf:rest :nil ] ] ] ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :has_part ;
                                                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :sea_water ;
                                                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                                                    owl:onProperty :has_quality ;
                                                                                                    owl:someValuesFrom :increased_acidity ] ;
                                                                                            rdf:rest :nil ] ] ] ] ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ],
        :acidification_of_an_aquatic_environment ;
    :has_definition "Ocean acidification is a process during which the pH of a sea or ocean is lowered." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chonolith rdfs:subClassOf :rock_intrusion ;
    :has_definition "A chonolith is an igneous rock intrusion of irregular shape with a demonstrable base, absent in other types of irregularly-shaped intrusions." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ecosystem_wide_aerobic_respiration rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :aerobic_respiration ],
        [ a owl:Restriction ;
            owl:onProperty :has_input ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first [ owl:intersectionOf [ rdf:first :dioxygen ;
                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                            owl:onProperty :has_role ;
                                                            owl:someValuesFrom :electron_acceptor ] ;
                                                    rdf:rest :nil ] ] ] ;
                            rdf:rest [ rdf:first [ owl:intersectionOf [ rdf:first :carbohydrate ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :has_role ;
                                                                    owl:someValuesFrom :nutrient ] ;
                                                            rdf:rest :nil ] ] ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :carbon_dioxide ;
                            rdf:rest [ rdf:first :liquid_water ;
                                    rdf:rest :nil ] ] ] ],
        :ecosystem_wide_respiration,
        :hydrological_process ;
    :has_definition "A process which consists of all aerobic respiration processes instantiated in an ecosystem." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:volcanic_eruption rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom :sulfur_dioxide ],
        [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom :carbon_monoxide ],
        [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom :hydrogen_sulfide ],
        [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom :hydrogen_chloride ],
        [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom :water_vapour ],
        [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom :dihydrogen ],
        [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom :carbon_dioxide ],
        [ a owl:Restriction ;
            owl:onProperty :has_input ;
            owl:someValuesFrom :magma ],
        [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :planetary_crust ],
        [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :volcano ],
        :hydrological_process,
        :material_transport_process ;
    :has_definition "A volcanic eruption is a process during which lava, tephra (ash, lapilli, volcanic bombs and blocks), and assorted gases are expelled from a volcanic vent or fissure." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:planetary_landmass rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :surrounded_by ;
            owl:someValuesFrom [ owl:complementOf [ owl:intersectionOf [ rdf:first :environmental_material ;
                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                    owl:onProperty :has_quality ;
                                                    owl:someValuesFrom :quality_of_a_liquid ] ;
                                            rdf:rest :nil ] ] ] ] ],
        :landmass,
        :planetary_surface ;
    :has_broad_synonym "land" ;
    :has_definition "A landmass which is part of a planet." ;
    :has_related_synonym "ground" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:liquid_planetary_surface rdfs:subClassOf :liquid_surface_of_an_astronomical_body,
        :planetary_surface ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :liquid_surface_of_an_astronomical_body ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :part_of ;
                                    owl:someValuesFrom :planet ] ;
                            rdf:rest :nil ] ] ] ;
    :has_related_synonym "A liquid planetary surface is a planetary surface layer where a liquid material of a planet comes into contact with atmosphere or outer space." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:outer_space rdfs:subClassOf :environmental_material ;
    :has_broad_synonym "space" ;
    :has_definition "Outer space is a hard vacuum containing a low density of particles, predominantly a plasma of hydrogen and helium as well as electromagnetic radiation, magnetic fields, neutrinos, dust and cosmic rays that exists between celestial bodies." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:planetary_crust rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :quality_of_a_solid ],
        :planetary_structural_layer ;
    :has_broad_synonym "crust" ;
    :has_definition "A planetary crust is the outermost solid shell of a rocky planet or natural satellite, which is chemically distinct from the underlying mantle." .
